import styled from "styled-components"
import waveImg from "../../assets/wave.png"

export default function WaveHeightDirection({ waveHeight, currentDirection }) {
    const waveH = [];
    const waveD = [];

    for (let i = 0; i < waveHeight.length; i++) {
        let obj = { heigth: waveHeight[i] }
        waveH.push(obj);
    }
    for (let i = 0; i < currentDirection.length; i++) {
        let obj = { direction: currentDirection[i] }
        waveD.push(obj);
    }
    console.log(waveD)
    return (
        <Content>
            <>
            {waveH.map((value, index) => (
                    <Wave
                        key={index}
                    />
                ))}
            </>
            <Information>
                {waveH.map((value, index) => (
                    <WHeight
                        key={index}
                        heigth={value.heigth}
                    />
                ))}
                {waveD.map((value, index) => (
                    <WDirection
                        key={index}
                        direction={value.direction}
                    />
                ))}
            </Information>
        </Content>
    )
}
function Wave(){

    return(
        <><img src={waveImg}/>
</>
    )
}

function WHeight({ heigth }) {
    console.log(heigth)
    return (
        <>{heigth}</>
    )
}
function WDirection({ direction }) {
    return (
        <>{direction}</>
    )
}
const Information=styled.div`
border: 2px solid red;
`
const Content = styled.div`
border: 2px solid purple;
width: 100%;
`
